def _partially_consume_prefix(self, prefix, column):
    lines = []
    current_line = ""
    current_column = 0
    wait_for_nl = False
    indent_count = 0

    for char in prefix:
        if wait_for_nl and char == '\n':
            indent_count = current_column  # Store the total indentation
            current_line += char
            lines.append(current_line)
            current_line = ""
            current_column = 0
            wait_for_nl = False
        elif wait_for_nl:
            continue
        elif char == ' ':
            current_column += 1
        elif char == '\t':
            current_column += 4
        elif char == '\n':
            current_column = 0
        else:
            if indent_count < column:
                res = ''.join(lines)
                return res, prefix[len(res):]

            current_line += ' ' * indent_count  # Add correct prior indentation
            current_line += char
            wait_for_nl = True

    return ''.join(lines), current_line
